import React from 'react';
import { getEvents } from '../../fetch';

import BookingCalendar from 'react-booking-calendar';

const bookings = [
	new Date(2016, 7, 1),
	new Date(2016, 7, 2),
	new Date(2016, 7, 3),
	new Date(2016, 7, 9),
	new Date(2016, 7, 10),
	new Date(2016, 7, 11),
	new Date(2016, 7, 12),
];

const HausbootRot = () => {
	return (
		<div>
			{getEvents((events) => console.log(events.map((event) => event.end)))}
			<BookingCalendar bookings={bookings} />
		</div>
	);
};

export default HausbootRot;
